DECLARE
  vr_idprglog NUMBER;
  vr_qtd      NUMBER := 0;

  PROCEDURE atualiza_dados(p_cop_n IN NUMBER, p_cta_n IN NUMBER, p_nb    IN NUMBER, 
                           p_cop_o IN NUMBER, p_cta_o IN NUMBER, p_seq_t IN NUMBER) IS
  BEGIN
    BEGIN
      UPDATE convenios.tbinss_beneficio_cooperado
         SET cdcooperativa = p_cop_n, nrconta = p_cta_n, nrbeneficiario = p_seq_t, dhregistro = SYSDATE
       WHERE nrbeneficio = p_nb AND cdcooperativa = p_cop_o AND nrconta = p_cta_o;
    EXCEPTION
      WHEN dup_val_on_index THEN
        NULL;
      WHEN OTHERS THEN
        cecred.pc_log_programa(pr_cdcooper   => 3,
                               pr_cdprograma => 'INSS_BENEFICIO_ERRO',
                               pr_dstiplog   => 'O',
                               pr_tpexecucao => 0,
                               pr_dsmensagem => 'p_nb: ' || p_nb || ' err: ' || SQLERRM,
                               pr_idprglog   => vr_idprglog);
    END;
    vr_qtd := vr_qtd + 1;
    IF vr_qtd >= 100 THEN
      COMMIT;
      vr_qtd := 0;
    END IF;
  END;
